import React from 'react'
import TodoItem from './TodoItem'

const Todos = (props) => {
  return (
    <div className='container'>
      <h3 className='text-center my-3'>Todos List</h3>
      <TodoItem todo = {props.todos[0]}/>
    </div>
  )
}

export default Todos
